import React from "react";
import '../components/component.css'

const Addnewvehicle = () => {
  return (
    <div className="addcontainer">
      <div>
        <label>Toll Name</label>
        <input placeholder="Enter toll name"></input>
      </div>
    </div>
  );
};

export default Addnewvehicle;
